import React from "react";
import Card from "react-bootstrap/Card";
import Buttons from "../../components/Buttons";
import { FaGooglePlay, AiFillApple } from "react-icons/fa";

function Landing() {
  return (
    <Card.Body>
      <Card.Title>
        <h1>Be truly borderless</h1>
      </Card.Title>
      <Card.Text>
        <p>
          Send and receive money globally. Create virtual dollar cards that work
          anywhere online.
        </p>
        
      </Card.Text>
    </Card.Body>
  );
}

export default Landing;
